define({"topics":[{"title":"Disabling secure meeting room names","shortdesc":"<p class=\"shortdesc\">Users are provisioned with a personal meeting room the first time that they log into         their meeting. Their personal meeting room is created with a secure name that cannot be         easily guessed by other users. For example: be:MeetMe.CWGRAff90q9HETLne4mhzA.<\/p>","href":"secure_rooms.html","attributes":{"data-id":"secure_rooms"},"menu":{"hasChildren":true},"tocID":"secure_rooms-d1909e1610","next":"secure_rooms-d1909e1610"},{"title":"Enabling conference dial-in","shortdesc":"<p class=\"shortdesc\">You can set up your environment to allow users to dial in to a meeting using a         SIP-capable phone system that is connected to a public switched telephone network (PSTN).         This feature uses the ilink TeamCall Meeting Gateway (TMG).<\/p>","href":"meetings_dialin.html","attributes":{"data-id":"meetings_dialin"},"menu":{"hasChildren":false},"tocID":"meetings_dialin-d1909e1661","topics":[]},{"title":"Enabling meeting dial-out","shortdesc":"<p class=\"shortdesc\">You can enable the dial-out option on Docker and Kubernetes.<\/p>","href":"enable_dial_out.html","attributes":{"data-id":"enable_dial_out"},"menu":{"hasChildren":true},"tocID":"enable_dial_out-d1909e1680","next":"enable_dial_out-d1909e1680"},{"title":"Configuring the maximum number of meeting participants","shortdesc":"<p class=\"shortdesc\">Sametime currently supports a maximum of 100 users in a meeting regardless of the         selected meeting mode. To reach a wider audience, you can start a live stream and share the         link to all intended         participants.<\/p>","href":"meetings_configuring_max.html","attributes":{"data-id":"meetings_configuring_max"},"menu":{"hasChildren":false},"tocID":"meetings_configuring_max-d1909e1731","topics":[]},{"title":"Enable Videobridge for TCP","shortdesc":"<p class=\"shortdesc\">This section provides steps to configure TCP for media streams using TCP port         4443.<\/p>","href":"enable_video_bridge.html","attributes":{"data-id":"enable_video_bridge"},"menu":{"hasChildren":false},"tocID":"enable_video_bridge-d1909e1750","topics":[]},{"title":"Disable sharing of meetings recording","shortdesc":"<p class=\"shortdesc\">By default meeting recordings can be shared with others. You can change a setting to         disable sharing of meeting recordings.<\/p>","href":"disable_sharing_meetings.html","attributes":{"data-id":"disable_sharing_meetings"},"menu":{"hasChildren":false},"tocID":"disable_sharing_meetings-d1909e1769","topics":[]},{"title":"Enabling Microsoft Outlook Add-in","shortdesc":"<p class=\"shortdesc\">To use the Sametime Meetings add-in for Microsoft Outlook it must be enabled on the         Sametime server. The add-in is provided as part of Sametime installation package. <\/p>","href":"enable_microsoft_outlook.html","attributes":{"data-id":"enable_microsoft_outlook"},"menu":{"hasChildren":false},"tocID":"enable_microsoft_outlook-d1909e1788","topics":[]},{"title":"Setting up a TURN server","shortdesc":"<p class=\"shortdesc\">A TURN server can be configured to provide for efficient traffic flow within your Sametime meeting.<\/p>","href":"turnserver_intro.html","attributes":{"data-id":"turnserver_intro"},"menu":{"hasChildren":true},"tocID":"turnserver_intro-d1909e1807","next":"turnserver_intro-d1909e1807"}]});